import React from 'react';
import { Link } from 'react-router-dom';

const StudentHomePage = () => {
  // Inline Styles
  const containerStyle = {
    fontFamily: 'Arial, sans-serif',
    padding: '30px',
    backgroundColor: '#f7f7f7',
    minHeight: '100vh',
  };

  const headerStyle = {
    textAlign: 'center',
    color: '#4CAF50',
    fontSize: '36px',
    fontWeight: 'bold',
    marginBottom: '20px',
    letterSpacing: '2px',
    textTransform: 'uppercase',
    textShadow: '2px 2px 5px rgba(0, 0, 0, 0.1)',
  };

  const navBarStyle = {
    display: 'flex',
    justifyContent: 'center',
    background: 'linear-gradient(90deg, rgba(0,123,255,1) 0%, rgba(0,197,255,1) 100%)',
    padding: '15px 0',
    borderRadius: '50px',
    boxShadow: '0 6px 10px rgba(0, 0, 0, 0.1)',
    marginBottom: '30px',
  };

  const linkStyle = {
    textDecoration: 'none',
    color: 'white',
    fontWeight: 'bold',
    margin: '0 20px',
    fontSize: '18px',
    padding: '10px 15px',
    borderRadius: '25px',
    transition: 'transform 0.3s ease, color 0.3s ease, background 0.3s ease',
    textTransform: 'uppercase',
  };

  const linkHoverStyle = {
    transform: 'scale(1.1)',
    backgroundColor: '#FFD700',
    color: '#004085',
  };

  const sectionStyle = {
    textAlign: 'center',
    marginBottom: '40px',
  };

  const footerStyle = {
    textAlign: 'center',
    color: '#777',
    fontSize: '14px',
    borderTop: '1px solid #ddd',
    paddingTop: '20px',
    marginTop: '40px',
    fontFamily: 'Arial, sans-serif',
  };

  const dashboardStyle = {
    display: 'grid',
    gridTemplateColumns: 'repeat(3, 1fr)',
    gap: '20px',
    marginBottom: '40px',
  };

  const cardStyle = {
    backgroundColor: '#fff',
    padding: '30px',
    borderRadius: '12px',
    boxShadow: '0 8px 15px rgba(0, 0, 0, 0.1)',
    textAlign: 'center',
    transition: 'transform 0.3s ease, box-shadow 0.3s ease',
  };

  const cardHoverStyle = {
    transform: 'scale(1.05)',
    boxShadow: '0 12px 25px rgba(0, 0, 0, 0.1)',
  };

  const cardHeaderStyle = {
    fontSize: '28px',
    color: '#007BFF',
    marginBottom: '20px',
    fontWeight: 'bold',
  };

  const cardContentStyle = {
    fontSize: '18px',
    color: '#555',
    marginBottom: '20px',
  };

  return (
    <div style={containerStyle}>
      <header style={headerStyle}>
        <h1>Welcome to Your Student Portal!</h1>
        <p>Your personal dashboard for managing courses, assignments, and grades.</p>
      </header>

      <div style={navBarStyle}>
        <Link to="/profile" style={linkStyle} className="nav-link">
          Profile
        </Link>
        <Link to="/courses" style={linkStyle} className="nav-link">
          Courses
        </Link>
        <Link to="/assignments" style={linkStyle} className="nav-link">
          Assignments
        </Link>
        <Link to="/grades" style={linkStyle} className="nav-link">
          Grades
        </Link>
        <Link to="/logout" style={linkStyle} className="nav-link">
          Logout
        </Link>
      </div>

      <section style={sectionStyle}>
        <h2 style={{ color: '#333' }}>Dashboard</h2>
        <p style={{ fontSize: '18px', color: '#666' }}>Quick overview of your current status and activities.</p>
      </section>

      <section style={dashboardStyle}>
        <div style={cardStyle} className="card">
          <h3 style={cardHeaderStyle}>Courses</h3>
          <p style={cardContentStyle}>Manage and view your enrolled courses.</p>
          <Link to="/courses" style={{ textDecoration: 'none', color: '#007BFF' }}>
            View Courses
          </Link>
        </div>

        <div style={cardStyle} className="card">
          <h3 style={cardHeaderStyle}>Assignments</h3>
          <p style={cardContentStyle}>Check your upcoming and completed assignments.</p>
          <Link to="/assignments" style={{ textDecoration: 'none', color: '#007BFF' }}>
            View Assignments
          </Link>
        </div>

        <div style={cardStyle} className="card">
          <h3 style={cardHeaderStyle}>Grades</h3>
          <p style={cardContentStyle}>View your grades and progress in courses.</p>
          <Link to="/grades" style={{ textDecoration: 'none', color: '#007BFF' }}>
            View Grades
          </Link>
        </div>
      </section>

      <section style={sectionStyle}>
        <h2 style={{ color: '#333' }}>Important Announcements</h2>
        <p style={{ fontSize: '18px', color: '#666' }}>Stay updated with the latest news and announcements from your professors.</p>
        <ul style={{ textAlign: 'left', paddingLeft: '20px', fontSize: '16px', color: '#444' }}>
          <li>New Assignment on Data Structures (Due: 20th Dec)</li>
          <li>Upcoming Exam Schedule Released</li>
          <li>Semester Break Starts on 1st Jan</li>
        </ul>
      </section>

      <footer style={footerStyle}>
        <p>&copy; 2024 Student Portal. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default StudentHomePage;
